import React from "react";
import styled from 'styled-components';

const AppAggroCardContainer = styled.div`
    width: 500px;
    height: 300px;
    background-color: var(--main-color);
    color: orange;
`;
export default function AppAggroCard(test) {
    return (
        <AppAggroCardContainer>
            {test}
        </AppAggroCardContainer>
    );
}
